ALTER TABLE `chi_product`
	ADD COLUMN `shipping_news_id` BIGINT(20) NULL DEFAULT NULL AFTER `warranty_id`;

CREATE TABLE `chi_attribute_group` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`name` VARCHAR(255) NULL DEFAULT NULL,
	`display_name` VARCHAR(255) NULL DEFAULT NULL,
	PRIMARY KEY (`id`)
